import * as React from 'react';

export const Navbar: React.FC = () => {
  const [isMenuOpen, setIsMenuOpen] = React.useState(false);

  return (
    <nav className="fixed top-0 left-0 right-0 bg-primary-blue shadow-lg z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-20">
          {/* Logo and Brand */}
          <div className="flex items-center">
            <div className="flex-shrink-0 flex items-center">
              <svg className="w-12 h-12" viewBox="0 0 100 100">
                <circle cx="50" cy="50" r="20" fill="#FF6B6B" />
                <circle cx="45" cy="45" r="5" fill="#4ECDC4" />
                <circle cx="55" cy="45" r="5" fill="#4ECDC4" />
                {[...Array(8)].map((_, i) => (
                  <path
                    key={i}
                    d={`M ${50 + 20 * Math.cos((i * Math.PI) / 4)} ${
                      50 + 20 * Math.sin((i * Math.PI) / 4)
                    } Q ${50 + 30 * Math.cos((i * Math.PI) / 4)} ${
                      50 + 30 * Math.sin((i * Math.PI) / 4)
                    } ${50 + 40 * Math.cos((i * Math.PI) / 4)} ${
                      50 + 40 * Math.sin((i * Math.PI) / 4)
                    }`}
                    stroke="#FF6B6B"
                    strokeWidth="3"
                    fill="none"
                  />
                ))}
              </svg>
              <span className="ml-3 text-2xl font-fredoka text-primary-mint">
                CuriousOzzy
              </span>
            </div>
          </div>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8">
            <a href="#home" className="nav-link">Home</a>
            <a href="#courses" className="nav-link">Courses</a>
            <a href="#programs" className="nav-link">Programs</a>
            <a href="#about" className="nav-link">About</a>
            <button className="btn-primary">
              Book a Session
            </button>
          </div>

          {/* Mobile Menu Button */}
          <div className="md:hidden flex items-center">
            <button
              onClick={() => setIsMenuOpen(!isMenuOpen)}
              className="text-primary-mint hover:text-primary-coral focus:outline-none"
            >
              <svg
                className="h-6 w-6"
                fill="none"
                viewBox="0 0 24 24"
                stroke="currentColor"
              >
                {isMenuOpen ? (
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M6 18L18 6M6 6l12 12"
                  />
                ) : (
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M4 6h16M4 12h16M4 18h16"
                  />
                )}
              </svg>
            </button>
          </div>
        </div>

        {/* Mobile Menu */}
        {isMenuOpen && (
          <div className="md:hidden">
            <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3">
              <a href="#home" className="mobile-nav-link">Home</a>
              <a href="#courses" className="mobile-nav-link">Courses</a>
              <a href="#programs" className="mobile-nav-link">Programs</a>
              <a href="#about" className="mobile-nav-link">About</a>
              <button className="w-full btn-primary-mobile">
                Book a Session
              </button>
            </div>
          </div>
        )}
      </div>
    </nav>
  );
};
